import { trackComponentName } from '@/coco-react/analytics'
import { EVideoStatus } from '@loc/server/enums/video'
import { isEqual } from 'lodash-es'
import { match } from 'ts-pattern'

import PositionWidget from '../PositionWidget'
import Failed from '../RecordVideos/Failed'
import GenerationContainer from '../RecordVideos/GenerationContainer'
import { parseAspectRatio } from '../utils'
import Actions from './Actions'
import { RecordImageItem } from './RecordImageItem'
import TempRecord from './TempRecord'

import type { CreationRecordItem } from '../../../_store/storeSlice/creationRecords'

interface RecordImageProps {
  data: CreationRecordItem
  className?: string
}

export const RecordImage = memo(
  (props: RecordImageProps) => {
    const { data, className } = props

    const generations = data.generations
    // 是否是临时记录
    const isTempRecord = !!data.temp?.recordId
    const generateRecordStatus = data.generateRecord.status

    const isSucceed = generateRecordStatus === EVideoStatus.Succeed
    const isFailed = generateRecordStatus === EVideoStatus.Failed
    const isWaiting = generateRecordStatus === EVideoStatus.Waiting
    const isProcessing = generateRecordStatus === EVideoStatus.Processing

    const aspectRatio = parseAspectRatio(data.generateRecord?.aspectRatio)

    return (
      <div
        className={cls`
          group/container flex w-fit flex-col gap-2
          ${isFailed ? 'max-w-full' : 'max-w-[290px] xl:max-w-[584px] 2xl:max-w-[878px] min-[1880px]:max-w-[1172px]'}
          ${className}
        `}
        data-widget-name={
          trackComponentName.project_detail.value.project_create_task_detail
            .name
        }
      >
        <div
          className='relative flex flex-wrap justify-center gap-1 md:justify-start'
          data-widget-name={
            trackComponentName.project_detail.value.project_content_card.name
          }
        >
          {match({ isTempRecord, isFailed, isWaiting, isSucceed, isProcessing })
            .with({ isTempRecord: true, isFailed: false }, () => (
              <TempRecord data={data} />
            ))
            .with({ isFailed: true }, () => (
              <GenerationContainer className='md:!w-[290px]'>
                <Failed data={data} isImage />
              </GenerationContainer>
            ))
            .with({ isWaiting: true }, () =>
              generations?.map((generation: any) => {
                if (generation.isFirstSubmit) {
                  return (
                    <div
                      key={generation.id}
                      className='group relative flex w-[325px] cursor-pointer flex-col items-center justify-center md:w-[290px]'
                      style={{ aspectRatio }}
                    >
                      <div
                        className='bg-f-bg-layout flex w-[300px] flex-1 flex-col items-center justify-center gap-2 object-cover md:w-[290px]'
                        style={{ aspectRatio }}
                      >
                        <span className='i-svg-spinners--180-ring-with-bg size-[35px]' />
                      </div>
                    </div>
                  )
                }

                return (
                  <div
                    key={generation.id}
                    className='group relative flex w-[325px] cursor-pointer flex-col items-center justify-center md:w-[290px]'
                    style={{ aspectRatio }}
                  >
                    <div
                      className='bg-f-bg-layout flex w-[300px] flex-1 flex-col items-center justify-center gap-2 object-cover md:w-[290px]'
                      style={{ aspectRatio }}
                    >
                      <span className='i-svg-spinners--180-ring-with-bg size-[35px]' />
                    </div>
                  </div>
                )
              }),
            )
            .when(
              ({ isSucceed, isProcessing }) => isSucceed || isProcessing,
              () => (
                <div
                  className={cls`relative flex flex-wrap justify-center gap-1 md:justify-start`}
                >
                  {generations?.map((generation: any, index: number) => (
                    <RecordImageItem
                      key={generation.videoId!}
                      index={index}
                      recordData={data}
                      data={generation}
                    />
                  ))}
                  {/* 滚动到原始图片位置 */}
                  <PositionWidget data={data} />
                </div>
              ),
            )
            .otherwise(() => null)}
        </div>

        {/* actions */}
        <Actions data={data} />
      </div>
    )
  },
  (prevProps, nextProps) => {
    return isEqual(prevProps, nextProps)
  },
)

import { Trans, useLingui } from '@lingui/react/macro'
import { EProcessVideoType } from '@loc/server/enums/video'
import { EntryCodeType } from '@loc/server/enums/video.common'
import { memo } from 'react'
import { match, P } from 'ts-pattern'

import MenuOptions from '../../MenuOptions'

import type { CreationRecordItem } from '../../../_store/storeSlice/creationRecords'
import type {
  MenuCustomOption,
  TImageMenuOptionKey,
} from '../../MenuOptions/_types'

interface RecordImageActionsProps {
  data: CreationRecordItem
  className?: string
}

function Actions(props: RecordImageActionsProps) {
  const { data } = props

  const { t } = useLingui()

  const { withdrawLoras } = useMemo(() => {
    const generationLoras = data.generateRecord.generationLoras ?? []
    const withdrawLoras = generationLoras.filter((lora) => lora.status === 0)
    return {
      withdrawLoras,
    }
  }, [data])

  const options = useMemo(() => {
    const hasWithdrawLora = withdrawLoras.length > 0
    const hasWithdrawLoraTitle = withdrawLoras
      .map((lora) => lora.title)
      .join(', ')

    return match(data)
      .returnType<MenuCustomOption<TImageMenuOptionKey>[]>()
      .with(
        P.union(
          {
            generateRecord: {
              processType: EProcessVideoType.IMAGE_BACKGROUND_REMOVER,
            },
          },
          { temp: { entryCode: EntryCodeType.BgRemove } },
        ),
        () => [
          {
            key: 're-edit',
            label: <Trans>Re-edit</Trans>,
          },
        ],
      )
      .with(
        P.union(
          {
            generateRecord: {
              processType: EProcessVideoType.IMAGE_OBJECT_REMOVER,
            },
          },
          { temp: { entryCode: EntryCodeType.ObjectRemover } },
        ),
        () => [
          {
            key: 're-edit',
            label: <Trans>Re-edit</Trans>,
          },
        ],
      )
      .with(
        P.union(
          {
            generateRecord: {
              processType: EProcessVideoType.IMAGE_UPSCALE,
            },
          },
          { temp: { entryCode: EntryCodeType.Upscale } },
        ),
        () => [
          {
            key: 're-edit',
            label: <Trans>Re-edit</Trans>,
          },
        ],
      )
      .with(
        P.union(
          {
            generateRecord: {
              processType: EProcessVideoType.IMAGE_PAINTING,
            },
          },
          { temp: { entryCode: EntryCodeType.PartialPainting } },
        ),
        () => [
          {
            key: 're-edit',
            label: <Trans>Re-edit</Trans>,
          },
        ],
      )
      .with(
        P.union(
          {
            generateRecord: {
              processType: EProcessVideoType.IMAGE_BACKGROUND_CHANGER,
            },
          },
          { temp: { entryCode: EntryCodeType.AiBackgroundChanger } },
        ),
        () => [
          {
            key: 're-edit',
            label: <Trans>Re-edit</Trans>,
          },
        ],
      )
      .with(
        P.union(
          {
            generateRecord: {
              processType: EProcessVideoType.IMAGE_UNCROP,
            },
          },
          { temp: { entryCode: EntryCodeType.Uncrop } },
        ),
        () => [
          {
            key: 're-edit',
            label: <Trans>Re-edit</Trans>,
          },
          {
            key: 'reGenerate',
            label: <Trans>Regenerate</Trans>,
          },
        ],
      )
      .with(
        P.union({
          generateRecord: {
            processType: EProcessVideoType.IMAGE_FACE_SWAP,
          },
        }),
        () => [
          {
            key: 're-edit',
            label: <Trans>Re-edit</Trans>,
          },
        ],
      )
      .otherwise(() => [
        {
          key: 'reprompt',
          label: <Trans>Reprompt</Trans>,
          disabled: hasWithdrawLora,
          tooltipProps: {
            title: hasWithdrawLora
              ? t`[${hasWithdrawLoraTitle}] has been removed. Please try a different LoRA.`
              : t`Reprompt`,
          },
        },
        {
          key: 'reGenerate',
          label: <Trans>Regenerate</Trans>,
          disabled: hasWithdrawLora,
          tooltipProps: {
            title: hasWithdrawLora
              ? t`[${hasWithdrawLoraTitle}] has been removed. Please try a different LoRA.`
              : t`Regenerate`,
          },
        },
      ])
      .map((i) => ({
        ...i,
        // showTooltip: true
      }))
  }, [data, t, withdrawLoras])

  const menuExpand = useMemo(() => {
    return options.map((item) => item.key)
  }, [options])

  const menuVisibleOptions = useMemo(() => {
    return [
      {
        key: 'deleteAll',
        label: <Trans>Delete All</Trans>,
        showTooltip: true,
      },
    ] as const as MenuCustomOption<TImageMenuOptionKey>[]
  }, [])

  return (
    <div className='flex items-center gap-x-1.5'>
      <MenuOptions
        // iconOnly
        className='flex-nowrap overflow-hidden'
        expand={menuExpand}
        optionClassName='overflow-hidden [&_.coco-btn-icon+div>span]:truncate h-7 flex items-center justify-center !bg-transparent border-f-border-secondary !border-solid hover:!text-f-text hover:!bg-f-bg-hover hover:!border-f-border-secondary'
        visibleOptions={options}
        menuType='image'
        data={data}
      />

      <MenuOptions
        iconOnly
        expand={['deleteAll']}
        className='transition-opacity group-hover/container:opacity-100 lg:opacity-0'
        optionClassName='h-7 flex items-center justify-center !bg-transparent border-f-border-secondary !border-solid hover:!text-f-text hover:!bg-f-bg-hover hover:!border-f-border-secondary'
        visibleOptions={menuVisibleOptions}
        menuType='image'
        data={data}
      />
    </div>
  )
}

export default memo(Actions)

import { useCreationRecordsV2 } from '@/hooks/useCreationRecordsV2'
import { useMobile } from '@/pages/pollo.ai/_hooks/useMobile'
import { EVideoStatus } from '@loc/server/enums/video'
import { useMemoizedFn } from 'ahooks'
import { memo } from 'react'

import { useDisplayRecordDetail } from '../hooks/useDisplayRecordDetail'
import { parseAspectRatio } from '../utils'
import { PureRecordImageItemUI } from './PureRecordImageItemUI'

import type { CreationItem, GenerationItem } from '../../../_types/video'
import type {
  MenuCustomOption,
  TImageMenuOptionKey,
} from '../../MenuOptions/_types'

export interface RecordImageItemProps {
  index: number
  recordData: CreationItem
  data: GenerationItem
}
export const RecordImageItem = memo((props: RecordImageItemProps) => {
  const { index, data, recordData } = props
  const src = useMemo(() => {
    return data.mediaUrl || data.videoUrl || ''
  }, [data.videoUrl, data.mediaUrl])

  const aspectRatio = parseAspectRatio(recordData.generateRecord?.aspectRatio)
  const { isMobile } = useMobile()

  const { onUpdateRecordFavorite } = useCreationRecordsV2()

  const { displayRecordDetail } = useDisplayRecordDetail()

  const isSucceed = data.status === EVideoStatus.Succeed && !!src
  const isProcessing = data.status === EVideoStatus.Processing

  const isFailed =
    (data.status === EVideoStatus.Succeed && !src) ||
    data.status === EVideoStatus.Failed

  const favoriteOnSuccess = useMemoizedFn(async (data) => {
    onUpdateRecordFavorite({
      recordData: data!,
      videoId: data!.videoId,
      favorite: Boolean(data!.favorite),
    })
  })

  const menuVisibleOptions = useMemo(() => {
    return [
      {
        key: 'download',
      },
      {
        key: 'share',
      },
      {
        key: 'favorite',
        showTooltip: true,
        onSuccess: favoriteOnSuccess,
        className: 'hover:text-f-orange-5',
      },
      {
        key: 'copyLink',
      },
      {
        key: 'delete',
      },
    ] as const as MenuCustomOption<TImageMenuOptionKey>[]
  }, [favoriteOnSuccess])

  return (
    <PureRecordImageItemUI
      src={src}
      isSucceed={isSucceed}
      isProcessing={isProcessing}
      aspectRatio={aspectRatio}
      displayRecordDetail={displayRecordDetail}
      recordData={recordData}
      index={index}
      data={data}
      menuVisibleOptions={menuVisibleOptions}
      favoriteOnSuccess={favoriteOnSuccess}
      isFailed={isFailed}
    />
  )
})

/**
 * 为了优化性能，临时抽取为纯 UI 组件，不包含业务逻辑
 */
import { useMobile } from '@/pages/pollo.ai/_hooks/useMobile'
import { Trans } from '@lingui/react/macro'
import { When } from 'react-if'

import type { CreationItem } from '@/pages/pollo.ai/_types/video'

import MenuOptions from '../../MenuOptions'
import FavoriteOption from '../../MenuOptions/_blocks/FavoriteOption'
import LoadingImage from './LoadingImage'

import type {
  MenuCustomOption,
  TImageMenuOptionKey,
} from '../../MenuOptions/_types'
import type { DisplayRecordDetailOptions } from '../hooks/useDisplayRecordDetail'
import type { RecordImageItemProps } from './RecordImageItem'
interface PureRecordImageItemUIProps {
  src: string
  isSucceed: boolean
  isProcessing: boolean
  aspectRatio: number
  displayRecordDetail: (
    recordData: CreationItem,
    options: DisplayRecordDetailOptions,
  ) => void
  recordData: RecordImageItemProps['recordData']
  index: RecordImageItemProps['index']
  data: RecordImageItemProps['data']
  menuVisibleOptions: MenuCustomOption<TImageMenuOptionKey>[]
  favoriteOnSuccess: (data: any) => Promise<void>
  isFailed: boolean
}

export const PureRecordImageItemUI = memo(
  (props: PureRecordImageItemUIProps) => {
    const {
      src,
      isSucceed,
      isProcessing,
      aspectRatio,
      displayRecordDetail,
      recordData,
      index,
      data,
      menuVisibleOptions,
      favoriteOnSuccess,
      isFailed,
    } = props
    const { isMobile } = useMobile()

    const menuOptionsExpand = useMemo(() => {
      return [
        'download',
        'share',
        'more',
        'divider',
        'favorite',
      ] as const as TImageMenuOptionKey[]
    }, [])

    const menuAlign = useMemo(() => {
      return {
        targetOffset: [0, 4],
      }
    }, [])

    const menuOptionsData = useMemo(() => {
      return {
        ...recordData,
        videoId: data.videoId,
        videoUrl: data.videoUrl || '',
        mediaUrl: data.mediaUrl || '',
        reallyVideoId: recordData.videoId,
        reallyVideoUrl: recordData.videoUrl || '',
        reallyMediaUrl: recordData.mediaUrl || '',
        favorite: data.favorite,
        generationId: data.videoId,
      }
    }, [data, recordData])

    const favoriteOptionData = useMemo(() => {
      return {
        ...recordData,
        videoId: data.videoId,
        videoUrl: data.videoUrl || '',
        reallyVideoId: recordData.videoId,
        reallyVideoUrl: recordData.videoUrl || '',
        favorite: data.favorite,
      }
    }, [data, recordData])

    const menuOptionsBottom = useMemo(() => {
      return (
        [
          {
            key: 'imageToVideo',
            showTooltip: true,
          },
          {
            key: 'imageToImage',
            showTooltip: true,
          },
          {
            // 新增：AI Shorts，展示在 Image to Image 右侧
            key: 'imageToShorts',
            showTooltip: true,
          },
          {
            key: 'inpaint',
            showTooltip: true,
          },
          {
            key: 'upscale',
            showTooltip: true,
          },
          {
            key: 'bgRemove',
            showTooltip: true,
          },
          {
            show: !isMobile,
            key: 'objectRemover',
            showTooltip: true,
          },
          {
            show: !isMobile,
            key: 'uncrop',
            showTooltip: true,
          },
          {
            key: 'aiBackground',
            showTooltip: true,
          },
        ] satisfies (MenuCustomOption<TImageMenuOptionKey> & {
          show?: boolean
        })[]
      )
        .map((i) => ({ show: true, ...i }))
        .filter((i) => i.show)
        .map(({ show, ...i }) => i)
    }, [isMobile])

    const menuOptionsBottomExpand = useMemo(() => {
      return menuOptionsBottom.slice(0, 5).map((i) => i.key)
    }, [menuOptionsBottom])

    return (
      <div
        key={src}
        className='group relative flex w-[290px] cursor-pointer items-center justify-center md:h-auto'
      >
        <When condition={isSucceed || isProcessing}>
          <div className='relative'>
            {src ? (
              <LoadingImage
                className={cls`flex-1 object-contain md:h-auto`}
                src={src}
                width={290}
                height={290 / aspectRatio}
                loadAddBgCheckered
                alt=''
                fallback={
                  '/images/text-to-image/record-item-image-fallback.png'
                }
                wrapperClassName='min-h-[168px]'
              />
            ) : (
              <div
                className='bg-f-bg-layout flex min-h-[164px] w-[290px] flex-1 flex-col items-center justify-center gap-2 object-cover py-4 md:min-h-[204px] md:w-[290px]'
                style={{ aspectRatio }}
              >
                <span className='i-svg-spinners--180-ring-with-bg size-[35px]' />
              </div>
            )}

            {/* actions */}
            <When condition={isSucceed}>
              <div
                onClick={(e) => {
                  const isFromToolbar =
                    (e.target as HTMLElement).closest('.toolbar') !== null
                  const isDropdown =
                    (e.target as HTMLElement).closest('.coco-dropdown-menu') !==
                    null

                  if (isFromToolbar || isDropdown) return
                  displayRecordDetail(recordData, {
                    currentSelectedGenerationIndex: index,
                  })
                }}
                className='absolute start-0 top-0 size-full duration-300 hover:bg-[#000000]/20'
              >
                <div
                  onClick={(e) => e.stopPropagation()}
                  className='toolbar w-fit-content absolute end-0 top-0 hidden items-center justify-end gap-x-1 md:flex'
                >
                  <MenuOptions
                    className={cls`bg-f-other-2 me-1 mt-1 flex gap-x-1 rounded p-0.5 group-hover:flex md:hidden`}
                    openClassName={cls`md:flex`}
                    optionClassName={cls`text-f-text hover:bg-f-other-2`}
                    optionOpenClassName={cls`bg-f-other-2 text-f-primary`}
                    expand={menuOptionsExpand}
                    iconClassName='size-4'
                    menuType='image'
                    visibleOptions={menuVisibleOptions}
                    data={menuOptionsData}
                    generation={data}
                    iconOnly
                    align={menuAlign}
                  />
                </div>
                <FavoriteOption
                  menuType='image'
                  className={cls`text-f-orange-5 absolute end-1.5 top-1.5 ${!data.favorite && 'hidden'} group-hover:hidden`}
                  data={favoriteOptionData}
                  generation={data}
                  onSuccess={favoriteOnSuccess}
                />

                <div
                  onClick={(e) => e.stopPropagation()}
                  className='toolbar w-fit-content absolute bottom-0 end-0 hidden items-center justify-end gap-x-1 md:flex'
                >
                  <MenuOptions
                    menuType='image'
                    className={cls`bg-f-other-2 mb-1 me-1 flex gap-x-1 rounded p-0.5 group-hover:flex md:hidden`}
                    openClassName={cls`md:flex`}
                    optionClassName={cls`text-f-text hover:bg-f-other-2`}
                    iconClassName='size-4'
                    optionOpenClassName={cls`bg-f-other-2 text-f-primary`}
                    expand={menuOptionsBottomExpand}
                    visibleOptions={menuOptionsBottom}
                    data={menuOptionsData}
                    generation={data}
                    iconOnly
                    align={menuAlign}
                  />
                </div>
              </div>
            </When>
          </div>
        </When>
        <When condition={isFailed}>
          <div
            style={{ aspectRatio }}
            className='bg-f-other-2 flex min-h-[140px] w-[290px] flex-1 flex-col items-center justify-center gap-2 object-contain md:h-auto md:w-[290px]'
          >
            <CssIcon className='i-cus--pol-img-fail text-f-text-tertiary size-[40px]' />
            <span className='text-f-text-quaternary text-center text-sm'>
              <Trans>Image generation failed. Credits will be returned.</Trans>
            </span>
          </div>
        </When>
      </div>
    )
  },
)

import { trackComponentName } from '@/coco-react/analytics'
import VideoPlayer from '@/components/VideoPlayer'
import { useCreationRecordsV2 } from '@/hooks/useCreationRecordsV2'
import { EVideoStatus } from '@loc/server/enums/video'
import { match } from 'ts-pattern'

import type { CreationItem } from '@/pages/pollo.ai/_types/video'

import { useGeneratingVideo } from '../../../_hooks/useGeneratingVideo'
import FavoriteOption from '../../MenuOptions/_blocks/FavoriteOption'
import BlurWrap from '../../VideoItem/_blocks/BlurWrap'
import { RenderExtension } from '../extensions/RenderExtension'
import { useDisplayRecordDetail } from '../hooks/useDisplayRecordDetail'
import Actions, { VideoHoverActions } from './Actions'
import { BottomRightActions } from './BottomRightActions'
import Failed from './Failed'
import GenerationContainer from './GenerationContainer'
import Pending from './Pending'
import Processing from './Processing'
import { TempVideoRecord } from './TempVideoRecord'
import VideoFlag from './VideoFlag'
import Waiting from './Waiting'

import type { CreationRecordItem } from '../../../_store/storeSlice/creationRecords'

interface IVideoProps {
  data: CreationRecordItem
  className?: string
}
export const RecordVideos = (props: IVideoProps) => {
  const { data, className } = props

  // 是否是临时记录
  const isTempRecord = !!data.temp?.recordId

  const generateRecordStatus = data.generateRecord.status
  const isRecordFailed = generateRecordStatus === EVideoStatus.Failed
  const isRecordSucced = generateRecordStatus === EVideoStatus.Succeed

  const { timeCostSeconds, waitingIndex, waitingCount } = useGeneratingVideo({
    recordId: Number(data.generateRecord.id),
    enabled: !isRecordSucced && !isRecordFailed,
  })
  const { updateRecord } = useCreationRecordsV2()
  const { displayRecordDetail } = useDisplayRecordDetail()

  const handleClick = (
    e: React.MouseEvent<HTMLDivElement> | React.TouchEvent<HTMLDivElement>,
    index: number,
    recordData: CreationItem,
  ) => {
    displayRecordDetail(recordData, {
      currentSelectedGenerationIndex: index,
    })
  }

  return (
    <div
      className='group/container relative flex max-w-full flex-col gap-2'
      data-widget-name={
        trackComponentName.project_detail.value.project_create_task_detail.name
      }
    >
      <div
        className='flex flex-wrap gap-2'
        data-widget-name={
          trackComponentName.project_detail.value.project_content_card.name
        }
      >
        {match(isRecordFailed)
          .with(true, () => {
            return (
              <GenerationContainer>
                <Failed data={data} />
              </GenerationContainer>
            )
          })
          .otherwise(() => {
            if (isTempRecord) {
              return <TempVideoRecord data={data} />
            }
            return data?.generations?.map((generation, index) => {
              const _videoSrc = generation.mediaUrl || generation.videoUrl || ''
              const cover = generation.cover || data.cover || ''
              const status = generation.status
              const r = Number(data.videoRatio?.split(':')[0]).toFixed(1)
              const isVideoAspectRatio169 = r === '1.7'
              return (
                <div
                  key={generation?.videoId}
                  id={`g-${generation.videoId}`}
                  className={cls`relative flex w-full max-w-full cursor-pointer flex-col rounded-md md:h-[288px] md:w-[438px] ${className}`}
                >
                  <div className='bg-f-bg-container flex max-h-full w-full max-w-full cursor-default flex-col md:h-[288px] md:min-w-[400px] md:max-w-[438px]'>
                    {match(status)
                      .with(EVideoStatus.Succeed, () => {
                        return (
                          <div className='group relative max-h-full w-full md:h-[288px] md:max-w-[438px]'>
                            {_videoSrc ? (
                              <BlurWrap
                                enableFill
                                coverImg={cover}
                                className='size-full'
                              >
                                <VideoPlayer
                                  src={_videoSrc}
                                  muted
                                  controls
                                  width={438}
                                  height={288}
                                  fluid={false}
                                  enableHoverPlay
                                  loop
                                  style={{
                                    objectFit: isVideoAspectRatio169
                                      ? 'fill'
                                      : undefined,
                                  }}
                                  handleTap={(e) => handleClick(e, index, data)}
                                  handleClick={(e) =>
                                    handleClick(e, index, data)
                                  }
                                />
                              </BlurWrap>
                            ) : (
                              <Failed data={data} />
                            )}
                            <VideoFlag />
                            <RenderExtension
                              type='videoSoundIcon'
                              props={{
                                detail: data,
                                className: 'absolute start-2 top-2 z-[2]',
                              }}
                            />

                            <VideoHoverActions
                              data={data}
                              className={cls`
                                video-hover-actions
                                bg-f-other-2
                                absolute end-0 top-0 me-1 mt-1 hidden w-fit rounded p-0.5
                                transition-opacity ease-in-out group-hover:opacity-100
                                md:me-2 md:mt-2 md:flex md:opacity-0
                              `}
                              openClassName='!flex !opacity-100'
                              optionClassName='size-6'
                              generation={generation}
                            />
                            <FavoriteOption
                              className={cls`text-f-orange-5 absolute hidden md:end-2.5 md:top-2.5 ${generation.favorite ? 'md:flex' : 'hidden'} group-hover:hidden`}
                              data={data}
                              generation={generation}
                              onSuccess={async (data) => {
                                updateRecord({
                                  ...data!,
                                  favorite: Boolean(data?.favorite),
                                })
                              }}
                              menuType='video'
                            />

                            <div
                              className={cls`
                                toolbar absolute bottom-8 end-0
                                hidden pe-0 ps-4 pt-4
                                opacity-100
                                transition-opacity ease-in-out
                                group-hover:opacity-100 md:flex
                                md:pe-2
                                md:opacity-0
                              `}
                            >
                              <BottomRightActions
                                data={data}
                                generation={generation}
                                onClick={(e) => {
                                  e.stopPropagation()
                                }}
                                openClassName='md:flex md:opacity-100'
                              />
                            </div>
                          </div>
                        )
                      })
                      .with(EVideoStatus.Waiting, () => {
                        if (generation.isFirstSubmit) {
                          return <Pending className='py-4' />
                        }

                        return (
                          <Waiting
                            waitingIndex={waitingIndex}
                            waitingCount={waitingCount}
                          />
                        )
                      })
                      .with(EVideoStatus.Processing, () => {
                        return (
                          <Processing
                            videoCreatedDate={generation?.createdDate}
                            estimatedTime={
                              timeCostSeconds
                                ? timeCostSeconds * 1000
                                : undefined
                            }
                            data={data}
                          />
                        )
                      })
                      .with(EVideoStatus.Failed, () => {
                        return <Failed data={data} />
                      })
                      .otherwise(() => {
                        return null
                      })}
                  </div>
                </div>
              )
            })
          })}
      </div>
      {/* actions */}
      <Actions data={data} />
    </div>
  )
}

